import React from 'react';
import './App.css';

function Page5({ inputValue1, inputValue2, inputValue3 }) {
  return (
    <div className="App">
      {/* Sol Üst Tarafta Input Değerlerini Gösterme */}
      <div className="input-summary">
        <div>
          <p className='p-input'>{inputValue1}</p>
          <p className="input-label">Matemask Accounts</p>
        </div>
        <div>
          <p className='p-input'>{inputValue2}</p>
          <p className="input-label">Twitter Accounts</p>
        </div>
        <div>
          <p className='p-input'>{inputValue3}</p>
          <p className="input-label">Telegram Accounts</p>
        </div>
      </div>

      {/* Merhaba Yazısı */}
      <p className="greeting">Merhaba!</p>

      {/* Büyük Başlık - Dünya */}
      <h1 className="large-heading">DÜNYA</h1>
    </div>
  );
}

export default Page5;
